package dynamicEasy;

public class SubsequenceEasy {
    public static void main(String[] args) {
        SubsequenceEasy subsequenceEasy = new SubsequenceEasy();

        String s = "leeeeetcode";
        String t = "";
        System.out.println(subsequenceEasy.isSubsequence(s, t));
    }

    public boolean isSubsequence(String t, String s) {
        if( t.isEmpty()){
            return true;
        }

        if( s.isEmpty()){
            return false;
        }
        int len = t.length();
        int counter = 0;
        int j = 0;

                        for (int i = 0; i < s.length(); i++) {
            if (t.charAt(j) == s.charAt(i)) {
                j++;
                counter++;
                if(j == len){
                   break;
                }
            }

        }

        return counter == len;

    }
}
